import React from "react";
import { API_OPTIONS } from "../../services/urlsservice";

const VideoBackground = ({ movieId }) => {
  let getTrailer = async () => {
    let response = await fetch(
      "https://api.themoviedb.org/3/movie/912649/videos?language=en-US",
      API_OPTIONS
    );
    let data = await response.json();
    let trailer = data.results.filter((d) => d.type === "Trailer");
    console.log(trailer);
  };
  getTrailer();
  return (
  <div>
    <iframe width="560" height="315" src="https://www.youtube.com/embed/FKBN1qAzW3s?si=Shw5JHVxt5xxG5m1" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe>
  </div>
  )
};

export default VideoBackground;
